define(["app/app"],function(o){"use strict";o.service("positionsService",["$http","$q",function(o,e){this.getPositions=function(){var i=e.defer();return o.get("/api/positions").then(function(o){i.resolve(o),console.log("FROM SERVICE:"+o)}),i.promise},this.setPosition=function(e){console.log("Service received position selected: "+e),o.post("/api/setposition",{position:e}).success(function(o,e,i){console.log(o)}).error(function(o,e,i){console.log("failure message from Angular POST: "+JSON.stringify({data:o}))})}}])});